import React from "react";

const Navbar = () => {
  return (
    <React.Fragment>
      <nav>
        <ul className="nav-left">
          <li>Home</li>
          <li>Host Your Own</li>
          <li>My Hostings</li>
          <li>About Us</li>
        </ul>
        <ul className="nav-right">
          <li>
            <button>Sign Up</button>
            <button>Log In</button>
          </li>
        </ul>
      </nav>

      <style jsx>{`
        nav {
          height: 55px;
          background: #dabc97;
          display: flex;
          justify-content: space-between;
        }

        li {
          list-style: none;
          font-size: 1.4rem;
        }

        .nav-left {
          display: flex;
          justify-content: space-evenly;
          align-items: center;
          width: 50%;
        }

        .nav-right {
          display: flex;
          align-items: center;
          justify-content: flex-end;
          width: 50%;
        }

        button {
          margin-right: 50px;
          background: aqua;
          width: 40px;
        }
      `}</style>
    </React.Fragment>
  );
};

export default Navbar;
